python3 - <<'PY'
import json, subprocess, re

repo='BillChirico/bills-bot'
prs_json=subprocess.check_output(['gh','pr','list','--repo',repo,'--state','open','--json','number,title,headRefName,author,url'], text=True)
prs=json.loads(prs_json)

skip=[]
eligible=[]
for pr in prs:
    login=(pr.get('author') or {}).get('login') or ''
    if login.endswith('[bot]') or login in {'coderabbitai','renovate'}:
        skip.append({'number':pr['number'],'author':login,'reason':'bot'})
    else:
        eligible.append(pr)

query='''
query($owner:String!, $name:String!, $number:Int!) {
  repository(owner:$owner, name:$name) {
    pullRequest(number:$number) {
      reviewThreads(first:100) {
        nodes {
          id
          isResolved
          comments(first:20) {
            nodes {
              id
              path
              line
              body
              author { login }
              url
              createdAt
            }
          }
        }
      }
    }
  }
}
'''

results=[]
for pr in eligible:
    number=pr['number']
    out=subprocess.check_output([
        'gh','api','graphql',
        '-f',f'query={query}',
        '-F',f'owner=BillChirico',
        '-F',f'name=bills-bot',
        '-F',f'number={number}'
    ], text=True)
    data=json.loads(out)
    threads=data['data']['repository']['pullRequest']['reviewThreads']['nodes'] if data.get('data') else []
    unresolved=[]
    for t in threads:
      if t.get('isResolved'):
        continue
      comments=t.get('comments',{}).get('nodes',[])
      comment=comments[-1] if comments else {}
      body=(comment.get('body') or '').strip()
      body_single=' '.join(body.split())
      summary=body_single[:240]
      unresolved.append({
        'threadId': t.get('id'),
        'path': comment.get('path'),
        'line': comment.get('line'),
        'summary': summary,
        'url': comment.get('url')
      })
    results.append({
      'number': number,
      'title': pr.get('title'),
      'branch': pr.get('headRefName'),
      'url': pr.get('url'),
      'author': (pr.get('author') or {}).get('login'),
      'unresolvedCount': len(unresolved),
      'unresolved': unresolved,
    })

print(json.dumps({'openCount':len(prs),'skipped':skip,'eligible':results}, indent=2))
PY

